import React from "react";

import "./Project.css";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const project = props => (
  <ul>
    <li>
      <img src={props.image} alt={props.title} />
    </li>
    <li>
      <ul>
        <li>Title</li>
        <li>Explanation</li>
        <li>[Paper]</li>
        <li>[Github]</li>
      </ul>
    </li>
  </ul>
);

export default project;
